// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract Perma is ERC1155, Ownable, Pausable {

    uint256 public price = 0.01 ether;
    mapping(address => bool) whitelist;
    string public name = "PERMALIFE";
    string public symbol = "PERMABAG";

     constructor(string memory uri_) ERC1155(uri_) Ownable(msg.sender) {
        name = "PERMALIFE";
        symbol = "PERMABAG";
    }

    function setWhitelist(address[] calldata addresses) external onlyOwner {
        for(uint256 i = 0; i < addresses.length; i++){
            whitelist[addresses[i]] = true;
        }
    }

    function setURI(string memory newuri) public onlyOwner {
        _setURI(newuri);
    }

    function uri(uint256 _id) public view virtual override returns(string memory) {
        return string(abi.encodePacked(super.uri(_id), Strings.toString(_id), ".json"));
    }

    function mint(address _owner, uint256 id, uint256 amount) public onlyOwner {
        _mint(_owner , id, amount, "");
    }

    function withdraw(address payable _addr) external onlyOwner {
        uint balance = address(this).balance;
        _addr.transfer(balance);
    }

    function mintBatch(address to, uint256[] memory ids, uint256[] memory amounts, bytes memory data) public onlyOwner {
        _mintBatch(to, ids, amounts, data);
    }
}
